import { CCol, CRow } from "@coreui/react";
import { Form } from "react-bootstrap";
import { useHistory } from "react-router";
import FormInput from "../UI/FormInput";
const EditProduct = () => {
  const history = useHistory();
  const onGoBackHandler = () => {
    history.push("/admin/store/item");
  };
  return (
    <Form>
      <CRow>
        <CCol md={6} sm={12}>
          <CRow>
            <FormInput
              md={12}
              sm={12}
              label="Product Name"
              id="name"
              type="text"
              readOnly={false}
            />
          </CRow>
          <CRow>
            <CCol md={4} sm={12}>
              
            </CCol>
            <FormInput
              md={12}
              sm={12}
              label="Price($)"
              id="price"
              type="text"
              readOnly={false}
            />
          </CRow>
          <CRow>
            <FormInput
              md={12}
              sm={12}
              label="Product Image"
              id="image"
              type="file"
              readOnly={false}
            />
          </CRow>
        </CCol>
        <CCol md={6} sm={12}></CCol>
      </CRow>
    </Form>
  );
};
export default EditProduct;
